import hamburger from './Komponensek/forrasok/hamburger.jpg';
import Pizza from './forrasok/Pizza.jpg';
import sandwich from './forrasok/sandwich.jpg';

export const Termekek = [

    {
       id: 1,
       termekNev: "Hamburger",
       ar: 1800 ,
       termekKep: hamburger,
    },
    {
        id: 2,
       termekNev: "Pizza",
       ar: 1200 ,
       termekKep: Pizza,
    },
    {
        id: 3,
       termekNev: "Sandwich",
       ar: 600,
       termekKep: sandwich,
    },
];
